// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@chainlink/contracts/src/v0.8/ChainlinkClient.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/proxy/utils/Initializable.sol";
import "./SongOracleStructs.sol";
import "./ISongOracle.sol";

/**
 * @title oracle to get the matching song
 * @author Vijay Dhanasekaran
 */
contract SongOracle is ChainlinkClient, AccessControl, Initializable, ISongOracle {

    bytes32 private constant OWNER = keccak256("OWNER");

    mapping(bytes32 => uint256) private _songs;

    /// @notice the url to get the song
    string public apiURL;

    /// @notice the chainlink node
    address public chainlinkNode;

    /// @notice the node job id
    bytes32 public jobId;

    /// @notice the fee in LINK
    uint256 public nodeFee;

    /// @notice the address of the LINK token
    address public linkToken;

    // solhint-disable-next-line
    constructor() {}

    // solhint-disable-next-line
    function initialize( SongOracleInfo memory _oracleInfo ) external initializer {
        linkToken = _oracleInfo.linkToken;
        chainlinkNode = _oracleInfo.chainlinkNode;
        jobId = stringToBytes32(_oracleInfo.jobId);
        nodeFee = (_oracleInfo.nodeFee * LINK_DIVISIBILITY) / 1000;

        apiURL = "https://backend-exchange-oracle-prod.privi.store/song?";

        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _setupRole(OWNER, msg.sender);

        setChainlinkToken(linkToken);
    }

    function setOracleInfo(SongOracleInfo calldata _oracleInfo) external onlyRole(OWNER) {
        linkToken = _oracleInfo.linkToken;
        chainlinkNode = _oracleInfo.chainlinkNode;
        jobId = stringToBytes32(_oracleInfo.jobId);
        nodeFee = (_oracleInfo.nodeFee * LINK_DIVISIBILITY) / 1000; // 0.01 LINK

        setChainlinkToken(linkToken);
    }

    function setAPIURL(string calldata _url) external onlyRole(OWNER) {
        apiURL = _url;
    }

    function findSong(uint64 parentId1, uint64 parentId2) external returns (bytes32 requestId) {

        Chainlink.Request memory request = buildChainlinkRequest(
            jobId,
            address(this),
            this.fulfillSong.selector
        );

        // set the request params
        Chainlink.add(
            request,
            "get",
            string(
                abi.encodePacked(
                    apiURL,
                    "parentId1=",
                    uint2str(parentId1),
                    "&parentId2=",
                    uint2str(parentId2)
                )
            )
        );
        Chainlink.add(request, "path", "songId");

        // Send the request
        return sendChainlinkRequestTo(chainlinkNode, request, nodeFee);
    }


    /**
     * @dev Receive the response in the form of uint256
     */
    // solhint-disable-next-line
    function fulfillSong(bytes32 _requestId, uint256 songId) public recordChainlinkFulfillment(_requestId) {
      _songs[_requestId] = songId;
    }

    /**
     * @dev returns the matching Song Id from the oracle
     */
    // solhint-disable-next-line
    function getSongId(bytes32 _requestId) external view override returns (uint256) {
        require( _requestId > 0, "Invalid request Id");
        uint256 _songId = _songs[_requestId];
        return _songId;
    }

    function stringToBytes32(string memory source) private pure returns (bytes32 result) {
        bytes memory tempEmptyStringTest = bytes(source);
        if (tempEmptyStringTest.length == 0) {
            return 0x0;
        }

        // solhint-disable-next-line no-inline-assembly
        assembly {
            result := mload(add(source, 32))
        }
    }

    function uint2str(uint256 _i) private pure returns (string memory _uintAsString) {
        if (_i == 0) {
            return "0";
        }
        uint256 j = _i;
        uint256 len;
        while (j != 0) {
            len++;
            j /= 10;
        }
        bytes memory bstr = new bytes(len);
        uint256 k = len;
        while (_i != 0) {
            k = k - 1;
            uint8 temp = (48 + uint8(_i - (_i / 10) * 10));
            bytes1 b1 = bytes1(temp);
            bstr[k] = b1;
            _i /= 10;
        }
        return string(bstr);
    }
}
